import React from "react";
import Meals from "../../assets/meals.jpg";

const Header = (props) => {
  return <React.Fragment>
    <header>
      <h1>ReactMeals</h1>
      <butt>Cart</butt>
    </header>
    <div>
      <img src={Meals} />
    </div>
  </React.Fragment>;
};

export default Header;
